import React from "react";
import pic from "./laugh-start.gif";
import FlipCardsub from "./FlipCardsub";
const FlipCard = () => {
  return (
    <div className="row container-fluid">
        <FlipCardsub/>
        <FlipCardsub/>
        <FlipCardsub/>
    </div>
  );
};

export default FlipCard;
